import { Box } from './Box';
import { memo } from 'react';

const Test = memo(function Container({
    cardName,
    cardImage,
    cardRarity,
    cardType,
    cardMonster,
    cardDesc,
    typeImage,
    cardAtk,
    cardDef
}) {

    return (
        <div ref={drag} role="Test" style={{ ...style, opacity }} data-testid={`box-${cardName}`}>
            < div className="card-container">

                <div className="generated-card">
                    <Box
                        cardName={cardName}
                        cardImage={cardImage}
                        cardRarity={cardRarity}
                        cardType={cardType}
                        typeImage={typeImage}
                        cardDesc={cardDesc}
                        cardMonster={cardMonster}
                        cardAtk={cardAtk}
                        cardDef={cardDef}
                    />
                </div>
            </div>
        </div>
    )
})

export default Test
